import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const DashboardPage = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    fetch('http://127.0.0.1:5000/logout', {
      method: 'DELETE'
    })
      .then(() => {
        navigate('/');
      })
      .catch((error) => {
        console.error('Error logging out:', error);
      });
  };

  return (
    <div className="p-3">
      <h2 className="text-2xl font-bold mb-4">Dashboard</h2>
      <div className="mb-4">
        <Link to="/rentals" className="text-blue-500 hover:underline">
          View Rentals
        </Link>
      </div>
      <div className="mb-4">
        <Link to="/bookings" className="text-blue-500 hover:underline">
          View Bookings
        </Link>
      </div>
      <div className="mb-4">
        <Link to="/manage-listings" className="text-blue-500 hover:underline">
          Manage Listings
        </Link>
      </div>
      <div className="mb-4">
        <Link to="/favorites" className="text-blue-500 hover:underline">
          View Favorites
        </Link>
      </div>
      <div className="mb-4">
        <Link to="/account-settings" className="text-blue-500 hover:underline">
          Account Settings
        </Link>
      </div>
      <div>
        <button
          onClick={handleLogout}
          className="bg-red-500 text-white rounded px-4 py-2 hover:bg-red-600"
        >
          Logout
        </button>
      </div>
    </div>
  );
};

export default DashboardPage;
